def legendre_symbol(a, p):
    t = pow(a, (p - 1)//2, p)
    return -1 if t == p - 1 else t

def square_root(a, p):
    if legendre_symbol(a, p) == 1:
        q = p - 1
        s = 0
        while q % 2 == 0:
            q //= 2
            s += 1
        z = 2
        while (legendre_symbol(z, p) != -1):
            z += 1
        m = s
        c = pow(z, q, p)
        t = pow(a, q, p)
        r = pow(a, (q + 1)//2, p)
        #print(r, t, c, m)
        while True:
            if t == 0:
                return 0
            elif t == 1:
                return r
            else:
                i = 0
                tem = t
                # print("t", t, "m", m)
                for i in range (m):
                    if tem == 1:
                        break
                    tem = pow(tem, 2, p)
                b = pow(c, 2**(m - i - 1), p)
                m = i
                c = (b * b) % p
                t = (t * c) % p
                r = (r * b) % p
    else:
        return 0

